    getMovie, getPopularMovies, getUpcomingMovies, getMovieCredits, getMovieImages, getMovieReviews, getTopRatedMovies, getGenres,
} from '../tmdb-api';

const router = express.Router();
let Regex = /^[1-9][0-9]*$/;

/**,
 * @swagger
 * /api/movies:
 *    get:
 *      tags:
 *       - movie
 *      summary: 
 *      produces:
 *      - application/json
 *      responses:
 *        200:
